package com.auxiliary.designer.visitor;public class Manager extends Employee {    public Manager(String name, String age, String responlity, String caplity) {        super(name, age, responlity);        this.caplity = caplity;    }    private String caplity;    public String getCaplity() {        return caplity;    }    public void setCaplity(String caplity) {        this.caplity = caplity;    }    @Override    public void accept(IVisitor visitor) {        visitor.visit(this);    }}